Explicación: Este poema satírico es un romance atribuido tradicionalmente a Rodrigo de Mendoza, poeta español del siglo XVI, conocido por su estilo burlesco y sus juegos de palabras. El poema hace una parodia de una supuesta expedición militar a Larache, jugando con el lenguaje y utilizando un diálogo humorístico lleno de juegos de palabras y referencias escatológicas.
